import ImageData from "@/app/objects/ImageData";

function buildMessages() {
    const rawImageMap = new Map();
    rawImageMap.set('Moderator', {
        "uri": "data:image/png;base64,",
        "width": 912,
        "height": 1024,
        "type": "image",
        "mimeType": "image/png",
        "fileName": "client.png",
        "fileSize": 11814,
        "file": {}
    });
    rawImageMap.set('Andy Ryan', {
        "uri": "data:image/jpeg;base64,",
        "width": 604,
        "height": 453,
        "type": "image",
        "mimeType": "image/jpeg",
        "fileName": "Andy.jpg",
        "fileSize": 64538,
        "file": {}
    });

    const imageMap = new Map();
    rawImageMap.forEach((rawObject, key) => {
        imageMap.set(key, new ImageData(
            { uri: rawObject.uri, width: rawObject.width, height: rawObject.height, type: rawObject.type, mimetype: rawObject.mimeType, fileName: rawObject.fileName, fileSize: rawObject.fileSize }        ));
    })
    return imageMap;
}

export const InitialUserImages = buildMessages();